    function cariData() {
        const key = document.getElementById('keyword').value.toLowerCase().trim();
        const container = document.getElementById('hasil-container');
        if (key.length === 0) { container.innerHTML = ""; return; }

        const hasil = dataWisuda.filter(i => i.nama.toLowerCase().includes(key) || i.no.toLowerCase().includes(key));
        container.innerHTML = hasil.slice(0, 15).map(item => `
            <div class="card guest-card p-3 shadow-sm">
                <div class="d-flex justify-content-between align-items-center">
                    <div>
                        <small class="text-muted fw-bold">NO: ${item.no}</small>
                        <h6 class="mb-0 fw-bold" style="color:var(--ump-blue)">${item.nama}</h6>
                    </div>
                    <div class="seat-tag">${item.lokasi}</div>
                </div>
            </div>
        `).join('');
    }

    function openFullscreen(src) {
        document.getElementById('fullscreenImg').src = src;
        document.getElementById('overlay').style.display = 'flex';
    }
    function closeFullscreen() {
        document.getElementById('overlay').style.display = 'none';
    }
</script>
